*/

// import { useState } from "react";

// @mui material components
import Grid from "@mui/material/Grid";
// import Card from "@mui/material/Card";

// Soft UI Dashboard PRO React components
import SuiBox from "components/SuiBox";

// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
// import Footer from "examples/Footer";


import { Table } from 'react-bootstrap';

function Notifications() {

  return (
    <DashboardLayout>
      <DashboardNavbar />
      <SuiBox mt={6} mb={3}>
        <Grid container>
          <Grid item xs={12} md={10} lg={12} py={3}>
            <Grid item xs={15} lg={12}>
              <SuiBox mb={3}>
              <Table striped bordered hover size="sm" style={{ textAlign: "center" }}>
                <thead>
                  <tr>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)",  padding: "15px", borderColor: 'white', width: '200px' }}>AMC Wise STP</th>
                    <th style={{ padding: "15px", borderColor: 'white', width: '200px' }}>Scheme Wise STP</th>
                    <th style={{backgroundColor: "rgb(249, 221, 171)",  padding: "15px", borderColor: 'white', width: '200px' }}>Client Wise SIP</th>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px", borderColor: 'white', width: '200px' }}>STP Maturing In 1 Month</th>
                  </tr>
                </thead>
              </Table>
              <br/>

                <Table striped bordered hover size="sm" style={{ textAlign: "center", borderColor: 'black' }}>
                  <thead>
                    <tr>
                      <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>Scheme Name</th>
                      <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>No Of STPS</th>
                      <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>STP Input</th>
                    </tr>
                  </thead>

                  <tbody>
                    <tr>
                      <td style={{ fontWeight: "900", backgroundColor: "#ddd" ,padding:"10px"}}>Total</td>
                      <td style={{ fontWeight: "900", backgroundColor: "#ddd" }}>0</td>
                      <td style={{ fontWeight: "900", backgroundColor: "#ddd" }}>0</td>
                    </tr>
                  </tbody>
                </Table>
              </SuiBox>
            </Grid>
          </Grid>
        </Grid>
      </SuiBox>
      {/* <Footer /> */}
    </DashboardLayout>
  );
}

export default Notifications;
